import React from 'react';
import { createRoot } from 'react-dom/client';
import App from './App';
import GlobalStyle from './globalStyles.js';

const root = createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <GlobalStyle />
    <App />
  </React.StrictMode>
);
